func countSubMultisets(nums []int, l int, r int) int {
    const mod = 1e9 + 7
    maxNum := 0
    for _, num := range nums {
        if num > maxNum {
            maxNum = num
        }
    }
    sum := make([]int, maxNum+1)
    for _, num := range nums {
        sum[num]++
    }
    dp := make([]int, r+1)
    dp[0] = 1
    for i := 1; i <= maxNum; i++ {
        if sum[i] == 0 {
            continue
        }
        for j := r; j >= 0; j-- {
            for k := 1; k <= sum[i] && k*i <= j; k++ {
                dp[j] = (dp[j] + dp[j-k*i]) % mod
            }
        }
    }
    ans := 0
    for i := l; i <= r; i++ {
        ans = (ans + dp[i]) % mod
    }
    return ans
}
